      background-color: rgb(21, 149, 184);

    }
  </style>
<body>

<h2>LOGIN Page</h2>

<form class="c">
  <input type="submit" value="HOME" (click)="home()">
  <div>
  First name: 
  <br><input type="text" id="fname" name="fname"><br>

  Last name: <br>
   <input type="text" id="lname" name="lname"><br>
   Email: <br>
   <input type="text" id="em" name="email"><br><br>
  <input type="submit" value="Submit">
</div>
</form> 



</body>
</html>
